class renderedModal extends React.Component{


	render(){

			return(
        <Modal trigger={<Button style={{marginTop:'775px'}} basic circular icon='comment alternate outline' size='huge'>Suggestion Box</Button>}>
		    <Modal.Header style={{color:'grey'}}>
